import React from 'react';
import './App.css';

function App() {
  // Services Section
  const Services = () => (
    <section id="services" className="section">
      <h2>Our Services</h2>
      <div className="service-list">
        <h3>Home Repair</h3>
        <p>Expert solutions for your home repair needs.</p>
        <h3>Electrical Work</h3>
        <p>Safe and reliable electrical services for your home or office.</p>
        <h3>Carpentry Work</h3>
        <p>High-quality carpentry services for custom projects and repairs.</p>
        <h3>Home Appliances Repair</h3>
        <p>Extend the life of your home appliances with our expert repair services.</p>
        <h3>Car Repair</h3>
        <p>Comprehensive car repair services to keep you on the road safely.</p>
      </div>
    </section>
  );

  // Contact Section
  const Contact = () => (
    <section id="contact" className="section">
      <h2>Book a Service</h2>
      <form>
        <input type="text" placeholder="Your Name" required />
        <input type="email" placeholder="Your Email" required />
        <select required>
          <option value="">Select a Service...</option>
          <option value="home-repair">Home Repair</option>
          <option value="electrical-work">Electrical Work</option>
          <option value="carpentry-work">Carpentry Work</option>
          <option value="home-appliances">Home Appliances Repair</option>
          <option value="car-repair">Car Repair</option>
        </select>
        <textarea placeholder="Describe your issue"></textarea>
        <button type="submit">Submit</button>
      </form>
    </section>
  );

  // Navigation
  const Navigation = () => (
    <nav className="navigation">
      <ul>
        <li><a href="#services">Services</a></li>
        <li><a href="#contact">Book a Service</a></li>
      </ul>
    </nav>
  );

  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to Quick Fix</h1>
        <p>Your one-stop solution for all repair needs.</p>
        <Navigation />
      </header>
      <main>
        <Services />
        <Contact />
      </main>
    </div>
  );
}

export default App;
